Qo6Ciispbmi2FLAUm+iioKP//Z","owner":{"id":"10361579608","username":"jayinslee"},"thumbnail_src":"https://scontent-lga3-1.cdninstagram.com/vp/61157de78b2455cbe67d3d89ed75a7af/5D1C46FF/t51.2885-15/e35/c157.0.405.405a/64498900_2284344598492433_6619348871169886702_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","thumbnail_resources":[{"src":"https://scontent-lga3-1.cdninstagram.com/vp/d257a40dc1a6f7ccc9ed3ec1d9351529/5D1C680E/t51.2885-15/e35/c157.0.405.405a/s150x150/64498900_2284344598492433_6619348871169886702_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":150,"config_height":150},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/5f5e5d76e07d805a41146e7a9899c168/5D1C22C8/t51.2885-15/e35/c157.0.405.405a/s240x240/64498900_2284344598492433_6619348871169886702_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":240,"config_height":240},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/9fcbe664663ffbe8e9dbc84fc2828e04/5D1C68B6/t51.2885-15/e35/c157.0.405.405a/s320x320/64498900_2284344598492433_6619348871169886702_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":320,"config_height":320},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/61157de78b2455cbe67d3d89ed75a7af/5D1C46FF/t51.2885-15/e35/c157.0.405.405a/64498900_2284344598492433_6619348871169886702_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":480,"config_height":480},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/61157de78b2455cbe67d3d89ed75a7af/5D1C46FF/t51.2885-15/e35/c157.0.405.405a/64498900_2284344598492433_6619348871169886702_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":640,"config_height":640}],"is_video":true,"video_view_count":2569}},{"node":{"__typename":"GraphSidecar","id":"2074944930861630543","edge_media_to_caption":{"edges":[{"node":{"text":"Photo 7: Our best memories are of doing ordinary things with our boys Jack, Connor, and Joe. They\u2019re grown and married, so now we have 3 daughters (their spouses), 3 grandchildren, and 1 more arriving in December.\n\u2014\nPhoto 8: We\u2019re also delighted to have two grand-pups and two grand-cats!\n\u2014\nPhoto 9: When my mom first met Jay, she told him, \u201cYou should go into politics.\u201d We just laughed at the time. Turns out, she was right. Jay first ran for the Washington House of Representatives in 1988. - @trudi_inslee"}}]},"shortcode":"BzLr2vMgURP","edge_media_to_comment":{"count":4},"comments_disabled":false,"taken_at_timestamp":1561572732,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-lga3-1.cdninstagram.com/vp/4660396fc5c4591cd307ee0f0171c23e/5DC148C5/t51.2885-15/e35/s1080x1080/64433662_1475767059228377_749293223029148206_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","edge_liked_by":{"count":524},"edge_media_preview_like":{"count":524},"location":null,"gating_info":null,"media_preview":null,"owner":{"id":"10361579608","username":"jayinslee"},"thumbnail_src":"https://scontent-lga3-1.cdninstagram.com/vp/df16d122e6628bfefab6b29cdfd9abb4/5DC11872/t51.2885-15/sh0.08/e35/s640x640/64433662_1475767059228377_749293223029148206_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","thumbnail_resources":[{"src":"https://scontent-lga3-1.cdninstagram.com/vp/a0e237a403ea930a0dc49a2717167564/5DC4A0D5/t51.2885-15/e35/s150x150/64433662_1475767059228377_749293223029148206_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":150,"config_height":150},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/be6c93a372399f8b2959cffeaa1f76ea/5DC2469F/t51.2885-15/e35/s240x240/64433662_1475767059228377_749293223029148206_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":240,"config_height":240},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/cc7da91eaacb29d5f95dfd690721d871/5DBEAE25/t51.2885-15/e35/s320x320/64433662_1475767059228377_749293223029148206_n.jpg?_nc_ht=scontent-lga3-1.cdninstagram.com","config_width":320,"config_height":320},{"src":"https://scontent-lga3-1.cdninstagram.com/vp/3f16005f4404f7450274209ca
